          email: 'shubham@iu.edu'
        },
        {
          firstName: 'Divyanshu',
          lastName: 'J',
          email: 'divyanshu@iu.edu'
        },
        {
          firstName: 'Bryant',
          lastName: 'H',
          email: 'bryant@iu.edu'
        },
        {
          firstName: 'Shubham',
          lastName: 'G',
          email: 'shubham@iu.edu'
        },{
          firstName: 'Shubham',
          lastName: 'G',
          email: 'shubham@iu.edu'
        }
      ]
    }
  }
  
  render() {
    let userCards = this.state.user.map(user => {
      return(
        <Column sm="3">
          <UserCard user={user}/>
        </Column>
      )
    })
    return(
      <div className="backGroundSAT">
        <div>
          <AdminNavBar/>
        </div>

        <div className="userCardComponent">

            <Row>
              {userCards}
            </Row>

        </div>
      </div>
    );
  }
};

export default VerifyUser;
